import './styles.css';
import logo from '../../assets/logo.png';

export default function SignIn() {
  return (
    <div className="container-center">
      <div className="login">
        <div className="login-area">
          <img src={logo} alt="Logo do sistema de chamados" />
        </div>
      </div>
    </div>
  );
}
